members.member:
Store link status for given High Availability Connection.

@param conn HA connection
@param message message to check
@return false - if message is not 'link status' or
         link status didn't change

Last link status sent to user:
-1 - unknown, messageId of linkEvent - if known

@return id of the link status message

member.summary:
PreviewInteractionResolver class.
Usage example:
Message msg = new Message();
...
PreviewInteractionFactory factory = 
    new PreviewInteractionFactory(new PreviewInteractionResolver());
KeyValueCollection kv = factory.Marshal(msg);
...
Message msg = (Message)factory.Unmarshal(kv);

member.remarks:
RequestCompleteConference requestComplete = RequestCompleteConference.Create(thisDn, connID, consultConnID);
If the request is successful, your application gets the EventRetrieved,EventPartyAdded, and EventPartyChanged events for the current call connId and the event EventReleased for the consultation call.
The application of the consulted agent gets the EventPartyChanged event, with a new ConnId (the PreviousConnId property of this event contains the value of the consultation call Id.)
